svg.script:

// Get the theme from localStorage or default to 'light'
var theme = localStorage.theme || 'light';

// Set the fill color based on the theme
function setFillColor() {
    var themeColor = (theme === 'light') ? '#ffffff' : '#101827';
    var elements = document.getElementsByClassName('dynamic-fill');

    for (var i = 0; i < elements.length; i++) {
        elements[i].setAttribute('fill', themeColor);
    }
}

// Call the function when the SVG is loaded
window.addEventListener('DOMContentLoaded', setFillColor);

// Listen for changes in the localStorage and update the theme
window.addEventListener('storage', function (event) {
    if (event.key === 'theme') {
        theme = localStorage.theme || 'light';
        setFillColor();
    }
});
